import React from 'react'
import { Link } from 'react-router-dom'

function homepage() {
    return (

        <div>
            <Link to="/">Home</Link>
            <Link to="./about-page">About</Link>
            <Link to="./contcat-page">Contcat</Link>
        </div>
    )
}

export default homepage
